  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Monte Vista National
  Wildlife Refuge outlines Refuge accomplishments from Sept through December of 1957.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  furbearers, predators, rodents, mammals, raptors, fish, and disease- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  collections and receipts. Resource management is outlined; topics include grazing
  and haying. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, Refuge participation, and hunting. N-R forms and photographs are
  attached\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
